スーパーマリオの仲間達が大集合した楽しいランチボックスが登場☆<br>
お弁当箱の1/2に約1.1杯分のご飯が入ります。<br>
フタを外せば電子レンジでも使えて、お弁当の作り置きにもぴったり◎<br>
お友達のものと区別しやすいお名前シール付き！<br>
<br>
【サイズ】<br>
165×105×55ｍｍ <br>
・容量：450ｍｌ<br>
<br>
【仕様】<br>
・仕切り付<br>
・食洗機対応<br>
・フタを外して電子レンジ使用可能<br>
・名前シール入り<br>
・日本製<br>
<br>
【材質】<br>
フタ：AS樹脂<br>
本体：ポリプロピレン<br>
止具：ABS樹脂<br>
パッキン：シリコン樹脂<br>
<br>
※商品写真はサンプルのため、デザイン等若干の差異が生じます。予めご了承ください。<br>
