”ぷっくり”したフォルムがとってもかわいい<br>
立体のマスコットが付いたランチシリーズです♪<br>
<br>
マスコットがフタに付いたキュートなお弁当箱です。<br><br>
フタを外して電子レンジ加熱も大丈夫です。<br>
お弁当箱1/2に入るご飯の量は、お茶わん約0.9杯。<br>
（お茶わん1杯＝200mlとして）<br>
名前シール入り。<br>
<br>
○商品サイズ：約149×123×60mm<br>
○容　量：360ml<br>
<br>
≪品質表示≫<br>
・フタ：ＡＳ樹脂／耐熱温度：100度<br>
・本体、中子：ポリプロピレン／耐熱温度：140度<br>
・止具：ＡＢＳ樹脂／耐熱温度：100度<br>
・パッキン：シリコン樹脂／耐熱温度：140度
<br><br>
